      {
        department_name: req.body.name,
        manager_id : req.body.id_manager,
        location_id: req.body.id_location,
      },
      { returning: true, where: { department_id: req.params.id } }
    );
    return res.send(department);
  } catch (error) {
    return res.send(error)
  }
};

